import React from 'react';
import Header from './components/Header'

function App() {
  state ={
    projects : [
      { projName: 'Classic Vacations', year: '2019-cont.', links:[ { name: 'Style Guide site', linkout:'http://classicvacationsdesign.com/' } ], description: 'Created a style guide with the UX designer'}
    ]
  }
  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
